import React, { Component, Img } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom';
import { Card, Badge } from 'antd';
// partials
import Calender from './partials/Calendar';

// css
import './App.css';
import 'antd/dist/antd.css';

class App extends Component {
  tripleCard () {
    let items = [
      'Add Item', 'Delete Item',
      'Misc.'
    ];
    let cards = items.map(item => <Card hoverable style={{width: 240}}> item </Card>)
    return cards;
  }
  render() {
    return (
      <div className="App">
        {this.tripleCard}
        <Calender/>
      </div>
    );
  }
}

export default App;
